def get_icon(icon: LiteralIcon, class_name: str = "", **props) -> rx.Component:
    if icon not in ICONS:
        raise ValueError(
            f"Icon '{icon}' not found. Available icons: {list(ICONS.keys())}"
        )
    return rx.html(
        ICONS[icon],
        class_name=f"flex justify-center items-center {class_name}",
        **props,
    )
